void fibonacci(std::ofstream& plik, const int n) {
	int a{}, b{ 1 }, c{};
	while ((b + c) < n) {
		a = b;
		b = c;
		c = a + b;
		plik << c << std::endl;
	}

	plik.close();
}

int main() {
	std::cout << "Podaj liczbe naturalna: ";
	int n;
	std::cin >> n;
	std::ofstream plik{ "fibonacci.txt" };
	fibonacci(plik, n);
	return 0;
}

