package ratelimit

import (
	"context"
	"errors"
	"sync"
	"time"
)

// Limiter is precise rate limiter with context support.
type Limiter struct {
	maxCount int
	interval time.Duration
	launched []time.Time
	locked   sync.Mutex
	stopped  bool
}

var ErrStopped = errors.New("limiter stopped")

// NewLimiter returns limiter that throttles rate of successful Acquire() calls
// to maxSize events at any given interval.
func NewLimiter(maxCount int, interval time.Duration) *Limiter {
	return &Limiter{maxCount: maxCount, interval: interval, launched: []time.Time{},
		locked: sync.Mutex{}, stopped: false}
}

func (l *Limiter) processAcquire(ctx context.Context) (bool, error) {
	if l.stopped {
		return true, ErrStopped
	}
	if ctx.Err() != nil {
		return true, ctx.Err()
	}

	for len(l.launched) > 0 && time.Since(l.launched[0]) > l.interval {
		l.launched = l.launched[1:]
	}

	if len(l.launched) < l.maxCount {
		l.launched = append(l.launched, time.Now())
		return true, nil
	} else {
		return false, nil
	}
}

func (l *Limiter) Acquire(ctx context.Context) error {
	for {
		l.locked.Lock()
		finish, err := l.processAcquire(ctx)
		l.locked.Unlock()
		if finish {
			return err
		} else {
			var sleepTime time.Duration = 0
			var interval time.Duration
			if l.interval < time.Second {
				interval = l.interval
			} else {
				interval = time.Second
			}
			for sleepTime < l.interval {
				time.Sleep(interval)
				sleepTime += interval
				if ctx.Err() != nil {
					return ctx.Err()
				}
			}
		}
	}
}

func (l *Limiter) Stop() {
	l.locked.Lock()
	l.stopped = true
	l.locked.Unlock()
}

bool primal(int liczba) {
	if (liczba < 2) {
		return false;
	}
	for (auto i{ 2 }; i * i <= liczba; ++i) {
		if (liczba % i == 0) {
			return false;
		}
	}
	return true;
}

